import React from "react";
import s from "./Main.module.css"
import GoodsCard from "../GoodsCard/GoodsCard";


const Main = (props) => {
    return (
        <div className={s.main}>
            <div className={s.mainwrapper}>
                <div className={s.goodswrapper}>
                    {props.notesData.map((note) => (
                     <div key={note.id}>
                        {note.note}
                     </div>
                    ))}
                </div>
            </div>
        </div>
    );
}

export default Main;
